script: |
  super -f tsv -I q12509.sql | sort > q12509.out

vector: true

inputs:
  - name: q12509.sql
    data: |
      SELECT - 4 AS col2 FROM tab1 cor0 WHERE NOT col2 - 26 + 4 BETWEEN ( NULL ) AND ( + col1 * - col0 );
  - name: tab1

outputs:
  - name: q12509.out
    data: |
      -4
      -4
      -4
